import { useSearchParams } from "react-router-dom";

const Redirect = () => {
    let [token_val, mod_token] = useState('');
    const [search_params, set_search_params] = useSearchParams();
    mod_token(search_params.get('token'));

    return (
        <div>로그인 리다이렉트</div>
    )
}

export default Redirect;
